@login_required
def activate_user(request, user_id):
    if not request.user.is_superuser:
        messages.error(request, 'You are not authorized to access this page', extra_tags='adminError')
        return redirect('saveTimes')
    else:
        user = User.objects.get(id=user_id)
        
        user.is_active = True
        user.save()
        
        return redirect('adminpanel')

def signin(request):
    if request.method == 'POST':
        username = request.POST['username']
        password = request.POST['password']
        user = authenticate(username=username, password=password)
        if user is not None:
            if not user.is_superuser:
                login(request, user)
                return redirect('saveTimes')
            else:
                login(request, user)
                return redirect('adminpanel')
        else:
            messages.error(request, "Invalid employee ID or password. Please try again.", extra_tags='login_error')
            return redirect('login')
    return render(request, 'login.html')

@login_required
def searchBar(request):
    if not request.user.is_superuser:
        messages.error(request, 'You are not authorized to access this page', extra_tags='adminError')
        return redirect('saveTimes')
    else:
        users = User.objects.filter(is_superuser=False).select_related('usertime')  # Only get non-superuser employees
        data = userTime.objects.all()

        if request.method == 'POST':
            search = request.POST.get('search')
            search_terms = search.split(' ')
            if len(search_terms) == 2:
                employees = users.filter(
                    Q(username__icontains=search_terms[0]) |
                    Q(first_name__icontains=search_terms[0]) |
                    Q(last_name__icontains=search_terms[1]) |
                    Q(first_name__icontains=search_terms[0], last_name__icontains=search_terms[1])
                ).values('id', 'username', 'first_name', 'last_name', 'is_active', 'usertime__middle_initial', 'usertime__image')
            else:
                employees = users.filter(
                    Q(username__icontains=search) |
                    Q(first_name__icontains=search) |
                    Q(last_name__icontains=search)
                ).values('id', 'username', 'first_name', 'last_name', 'is_active', 'usertime__middle_initial', 'usertime__image' )
            return render(request, 'adminpanel.html', {'search': search, 'employees': employees, 'data': data})
        else:
            search = None  # Define search as None when request.method is not 'POST'
            employees = None  # Define employees as None when request.method is not 'POST'
            return render(request, 'adminpanel.html', {'users': users, 'data': data})


def signout(request):
    logout(request)
    return redirect('login')


@login_required
def change_password(request, user_id):
    if request.method == 'POST':
        old_password = request.POST['old_password']
        new_password = request.POST['new_password']
        confirm_password = request.POST['confirm_password']
        user = get_object_or_404(User, id=user_id)

        if not user.check_password(old_password):
            messages.error(request, 'Old password does not match.', extra_tags='oldPasswordError')
            return redirect('change-password', user_id=user_id)

        if new_password != confirm_password:
            messages.error(request, 'New password and confirm password do not match.', extra_tags="newAndOldPassError")
            return redirect('change-password', user_id=user_id)

        user.set_password(new_password)
        user.save()
        messages.success(request, 'Password has been changed.', extra_tags="passwordChangeSuccess")
        return redirect('login')

    return render(request, 'change_password.html')


@login_required
def my_reports(request, employee_id):
    user = request.user

    if not user.is_authenticated:
        messages.error(request, 'No active user. Please log in.', extra_tags='noReport')
        return redirect('login')

    if user.is_superuser:
        return _my_reports_superuser(request, employee_id)
    else:
        return _my_reports_normal_user(request, employee_id)


def _my_reports_superuser(request, employee_id):
    try:
        selected_user = User.objects.get(id=employee_id)
    except User.DoesNotExist:
        selected_user = None

    time_entries = TimeEntry.objects.filter(user_id=employee_id)

    context = {
        'time_entries': time_entries,
        'selected_user': selected_user,
    }

    return render(request, 'reports.html', context)


def _my_reports_normal_user(request, employee_id):
    user = request.user
    if not user.is_superuser and user.id != employee_id:
        messages.error(request, 'You do not have access to this user\'s reports.', extra_tags='noReport')
        return redirect('saveTimes')
    try:
        selected_user = User.objects.get(id=employee_id)
    except User.DoesNotExist:
        selected_user = None

    time_entries = TimeEntry.objects.filter(user=user, user_id=employee_id)

    context = {
        'time_entries': time_entries,
        'selected_user': selected_user,
    }

    return render(request, 'reports.html', context)

@login_required
def show_dtr_archive(request, entry_id):
    user = request.user

    # Check if the logged-in user is a superuser
    if not user.is_superuser:
        try:
            time_entry = TimeEntry.objects.get(id=entry_id, user=user)
        except TimeEntry.DoesNotExist:
            messages.error(request, 'You do not have access to this time entry.', extra_tags='timeEntryErr')
            return redirect('saveTimes')
    else:
        # Superuser can access any time entry
        time_entry = get_object_or_404(TimeEntry, id=entry_id)

    deserialized_list = json.loads(time_entry.list_of_days)

    context = {
        'time_entry': time_entry,
        'my_list': deserialized_list,
    }

    return render(request, 'dtr_archive.html', context)


@login_required
def holiday(request):
    if request.method == 'POST':
        user=request.user
        remarks = request.POST.get('remarks')
        day = request.POST.get('day')
        month = request.POST.get('month')
        year = request.POST.get('year')
        if request.POST.get('morning') == 'on':
            morning_suspension = True
        else:
            morning_suspension = False
        if request.POST.get('afternoon') == 'on':
            afternoon_suspension = True
        else:
            afternoon_suspension = False


        holiday_entry = Holiday(user=user, remarks=remarks, day=day, month=month, year=year, morning_suspension=morning_suspension, afternoon_suspension=afternoon_suspension)
        holiday_entry.save()
        


        if user.is_superuser:
            messages.success(request, 'Event saved!', extra_tags='eventSuccess')
            return redirect('adminpanel')
        else:
            messages.success(request, 'Event saved!', extra_tags='eventSuccess')
            return redirect('saveTimes')
    return render(request, 'form.html')

@login_required
def make_up_class(request):
    if request.method == 'POST':
        user=request.user
        morning_time_in = request.POST.get('morning_time_in')
        morning_time_out = request.POST.get('morning_time_out')
        afternoon_time_in = request.POST.get('afternoon_time_in')
        afternoon_time_out = request.POST.get('afternoon_time_out')
        day = request.POST.get('day')
        month = request.POST.get('month')
        year = request.POST.get('year')


        makeup_entry = MakeUpClass(user=user, morning_time_in=morning_time_in, morning_time_out=morning_time_out, afternoon_time_in=afternoon_time_in, afternoon_time_out=afternoon_time_out, 
                               day=day, month=month, year=year)
        makeup_entry.save()

        messages.success(request, 'Make up class added!', extra_tags='makeUpSuccess')
        return render(request, 'make-up.html')
    return render(request, 'make-up.html')

