def generate_random_time(inputted_hour, inputted_minute, min_offset=-10, max_offset=10):
    total_minutes = inputted_hour * 60 + inputted_minute
    random_offset = random.randint(min_offset, max_offset)
    random_minutes = total_minutes + random_offset
    random_minutes = max(0, min(random_minutes, 1439))
    random_hour, random_minute = divmod(random_minutes, 60)
    return random_hour, random_minute